import React from "react";
import "./App.css";
import Navbar from "./Navbar";
import Home from "./Home";
import Box from "./home/Box";
import Footer from "./Footer";
export default function App() {
  return (
    <>
      <div className="landing-page">
        <Navbar />
        <Home />
      </div>
      <Box />
      <Links />
      <Footer />
    </>
  );
}
